class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        if s == "":
            return t
        char_count = {}
        for char in s:
            char_count[char] = char_count.get(char, 0) + 1
        for char in t:
            char_count[char] = char_count.get(char, 0) - 1
        print(char_count)
        for char, count in char_count.items():
            if count == 1 or count == -1:
                return char


my_sol = Solution()

print(my_sol.findTheDifference(
    "",
    ""))

# expected output "t"
